import React, { Component } from 'react';
import Input from './share/input';


class form extends Component {
    render() {
        return (
            <div> 
                <Input
                    type="text"
                    labelTxt="Name"
                    error="Pls fill form"
                    onChange={this.handlerChange}
                    placholder="Your Name"
                />

            </div>
        );
    }
}

export default form;
